tinymce.PluginManager.add("ampforwp_tc_button",function(t,n){t.addButton("ampforwp_tc_button",{text:"Copy The Content",icon:"dashicons dashicons-clipboard",classes:"ampforwp-copy-content-button ",tooltip:"Visual Editor to AMP Editor",onclick:function(){null!=typeof tinymce.editors.content.getContent()?t.insertContent(tinymce.editors.content.getContent()):t.insertContent(document.getElementById("content").value())}})});